"use strict";for(var faqItem=document.getElementsByClassName("faq__item"),i=0;i<faqItem.length;i++)faqItem[i].addEventListener("click",function(t){if(t.preventDefault(),this.classList.contains("faq__item_active")){if(this.classList.contains("faq__item_active"))for(e=0;e<faqItem.length;e++)faqItem[e].classList.remove("faq__item_active")}else{for(var e=0;e<faqItem.length;e++)faqItem[e].classList.remove("faq__item_active");this.classList.add("faq__item_active")}});